import { Link } from 'react-router-dom'
import './App.css'
import { images, useWindowDimensions } from './constants'

function App() {
  const { height, width } = useWindowDimensions()
  const placeholderStyle = {
    color: '#e1e1eb',
  }

  const windowWidth = useRef(window.innerWidth)
  const windowHeight = useRef(window.innerHeight)
  return (
    <div className="App">
      <div
        style={{
          display: 'flex',
          height: height * 0.09,
          backgroundColor: '#171544',
          flexDirection: 'row',
        }}
      >
        <img
          src={'https://i.imgur.com/hPbfzZ2.png'}
          alt="Logo image T&C"
          style={{
            height: height * 0.09 - 26,
            marginTop: 13,
            marginBottom: 13,
            marginLeft: 10,
            marginRight: 13,
          }}
        />
        <Link to="/PushImage" style={{ textDecoration: 'none' }}>
          <div
            style={{
              display: 'flex',
              flexDirection: 'row',
              height: height * 0.09 - 26,
              width: width * 0.076,
              marginTop: 13,
              marginBottom: 13,
              backgroundColor: '#1bb76e',
              marginLeft: 15,
              borderRadius: 3,
              boxShadow: '0px 2px 6px rgba(1,1,1, 0.3)',
            }}
          >
            <img
              src={images.add_new_image}
              style={{
                height: height * 0.09 - 36,
                marginTop: 5,
                marginBottom: 5,
                marginLeft: 6,
              }}
            />
            <span
              style={{
                fontSize: 13,
                color: '#fff',
                fontWeight: '500',
                alignSelf: 'center',
                marginLeft: 5,
              }}
            >
              Push Image
            </span>
          </div>
        </Link>

        <div
          style={{
            flex: 1,
            height: height * 0.09,
          }}
        >
          <form action="/search">
            <input
              type="text"
              placeholder="Images, #tags, @users oh my!"
              style={{
                alignSelf: 'center',
                height: height * 0.09 - 26,
                width: width * 0.26,
                marginTop: 13,
                marginBottom: 13,
                backgroundColor: '#454469',
                padding: '0px  0px 0px 10px',
                border: '1px solid transparent',
                borderRadius: '3px',
                outline: '0',
                opacity: '0.8',
                fontSize: '16px',
                fontWeight: '500',
                letterSpacing: '0.4px',
                color: '#fff',
                textShadow: 'inherit',
                boxShadow: '0px 2px 6px rgba(32,32,32, 0.3)',
              }}
            />
            <style>{`input::placeholder {
            color: ${placeholderStyle.color};
            padding: ${placeholderStyle.padding}; }`}</style>
            <img
              src={images.search}
              style={{
                height: height * 0.09 - 38.5,
                marginLeft: 6,
                position: 'relative',
                top: '7px',
                right: '35px',
                filter: 'invert(100%)',
              }}
            />
          </form>
        </div>

        <div
          style={{
            width: width * 0.16,
            display: 'flex',
            flexDirection: 'row',
          }}
        >
          <div
            style={{
              justifyContent: 'center',
              alignItems: 'center',
              display: 'flex',
            }}
          >
            <img
              src={images.login}
              style={{
                height: height * 0.09 - 32,
                marginLeft: 10,
                marginRight: 10,
                filter: 'invert(100%)',
              }}
            />
          </div>
          <div
            style={{
              justifyContent: 'center',
              alignItems: 'center',
              display: 'flex',
            }}
          >
            <img
              src={images.bell}
              style={{
                height: height * 0.09 - 32,
                marginLeft: 10,
                marginRight: 10,
                filter: 'invert(100%)',
              }}
            />
          </div>
          <div
            style={{
              flex: 1,
              display: 'flex',
              flexDirection: 'row',
              justifyContent: 'flex-end',
            }}
          >
            <p
              style={{
                alignSelf: 'center',
                fontSize: 15,
                color: '#f7f6f6',
                fontWeight: 'bold',
                marginLeft: 10,
                marginRight: 10,
              }}
            >
              the joker
            </p>
            <img
              src={images.user}
              style={{
                height: height * 0.09 - 23,
                alignSelf: 'center',
                marginRight: 15,
                boxShadow: '0px 2px 6px rgba(1,1,1, 0.4)',
              }}
            />
          </div>
        </div>
      </div>
      <div
        style={{
          height: height * 0.1,
          backgroundColor: '#171544',
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center',
        }}
      >
        <p
          style={{
            color: '#acd7ea',
            fontWeight: 'bold',
            fontSize: 20,
          }}
        >
          The only sensible way to live in this world is without rules.
        </p>
      </div>
      <div
        style={{
          backgroundColor: '#171544',
          height: height * 0.26,
          paddingLeft: width * 0.05,
          fontWeight: 'bold',
          paddingRight: 25,
        }}
      >
        <span
          style={{
            float: 'left',
            color: '#8e8cbb',
            textTransform: 'uppercase',
          }}
        >
          EXPLORE TAGS
        </span>
        <div style={{}}></div>
      </div>
      <div>
        <h2>Width: {windowWidth.current}</h2>

        <h2>Height: {windowHeight.current}</h2>
      </div>
    </div>
  )
}

export default App
